function debug_report(item){try{if(console&&(typeof item==="function"||typeof item==="object")){console.log("Analyzing "+typeof item+" item.");console.log(item);}else if(console&&typeof item==="string"){console.log(item);}else{throw"Console not supported. Item is not an object, function, or string."}}catch(error){if(console){console.log("Error caught: "+error);}}finally{window.onerror=function(message,url,linenumber){if(console){console.log("Error: "+message+" on line "+linenumber+" for "+url);}}}}function safe_exec(input){debug_report("Safely executing item");try{if(typeof input==="function"){input();}else if(typeof input==="object"){debug_report(input);}else{throw"Not a function or an object."}}catch(error){debug_report("Error caught:");debug_report(error);debug_report(input);}finally{window.onerror=function(message,url,linenumber){debug_report("Error: "+message+" on line "+linenumber+" for "+url);}}}$(document).ready(function(){$("body, p, label, input, select").typeset();if(!Modernizr.svg){$('img[src*="svg"]').attr('src',function(){return $(this).attr('src').replace('.svg','.png');});}if(adaptive_scripts.attach_scrollto){$("a").click(function(event){event.preventDefault();var url=$(this).attr("href");var rel=$(this).attr("rel");if(url&&url!=="#"&&!rel){if(url.substr(0,1)=="#"&&adaptive_scripts.attach_scrollto){$.scrollTo($(url),1000);}else{$(".container").fadeOut("fast").css("display: none");document.location.href=url;}}});}});